  return (
    <div>
      {/* <Header /> */}
      <div>
        {/* Content for the home page */}
        <h2>Welcome to Explore Epic!</h2>
        <p>Explore amazing destinations and plan your next adventure.</p>
      </div>
    </div>
  );
}

export default Home;
